import React from 'react'
import './App.css'
import Forecast from "./components/forecast/Forecast"

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>React Weather App</h1>
      </header>

      <main>
        <Forecast />
      </main>
    </div>
  );
}

export default App;
